const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<SignIn/>}/>   
        <Route path="/" element={<SignUp/>}/>   
        <Route path="/" element={<ProjectList/>}/>   
        <Route path="/" element={<MyPage/>}/>      
      </Routes>
    </Router>
  );
}

export default App;
